import React,{ useRef, useState } from "react";
import axios from 'axios';



const Registration = () => {
    const [data,setData]=useState({name:'',email:'',password:'',number:''})
    // const [name,setName]=useState("");
    // const [email,setEmail]=useState("");
    // const [password,setPassword]=useState("");
    // const [number,setNumber]=useState("");
    
    
    
    const ref1 = useRef();
    const handleUpdate=()=>{
      setData({...data,[e.target.name]:e.target.value});
    }
    const PostData=()=>{
      // data.preventDefault();
      axios.post('http://localhost:4000/regRoute/register',{name:data.name,email,password,number}).then((res)=>{console.log(res.data);
          ref1.current.innerText=res.data.msg;
        }
      ).catch(err=>(err.message));
    } 
  return (
    <>
      <section>
        <div>    
        <label htmlFor=""> Name: </label>
        <input type="text" name="name" onChange={handleUpdate}/> <br /> <br />
        <label htmlFor=""> Email: </label>
         <input type="email" name="email" onChange={handleUpdate}/> <br /> <br />
         <label htmlFor="">Password: </label>
         <input type="password" name="password" onChange={handleUpdate}/> <br /> <br />
         <label htmlFor="">  Phone No.: </label>
         <input type="text" name="number" onChange={handleUpdate}/> <br /> <br />
            <button onClick={PostData}>Data Post</button>    
        </div>
        <div>

        </div>
      </section>
    </>
  )
}

export default Registration
